        <Title text='Qual sua mÃ©dia mensal de faturamento?' />
        <div className='yesNoGroup'>
          <Button
            path='/localidade'
            label='Continuar'
          />
          <Button
            path='/localidade'
            label='Ganho mais de R$ 6750,00'
